import React from 'react';
import IoT from './IoT.png'
import './Logo.css';
import Tilt from 'react-tilt';


const Logo =({onLogoClick})=>
{
	return(
    <div className='ma4 mt0'>
		<div className='ma4'>
		<Tilt className='Tilt'options={{ max : 45 }} style={{ height: 150, width: 150 }}>
      <div className="pa3"><img onClick={this.props.onLogoClick} alt='logo' src={IoT}/></div>
		</Tilt>
		</div>
		<div>
    <span className='f2 hover-dark-blue'>Internet of Things</span>
		</div>
    </div>

    );
}

export default Logo;
